import React from 'react'
import './Checkout.css';
import Container from 'react-bootstrap/Container'
import Col from 'react-bootstrap/Col'
import Row from 'react-bootstrap/Row'
import Subtotal from './Subtotal'
import { useStateValue } from '../Hooks/StateProvider';
import CheckoutProduct from './CheckoutProduct';

export default function Checkout() {

   const [{basket},dispatch] = useStateValue();

    return (
        <div className="checkout">
            <Container>
                <Row>
                    <Col xl={8}>
                        <div className="Checkout_left">
                            <img className="check_image" src="https://images-na.ssl-images-amazon.com/images/G/02/UK_CCMP/TM/OCC_Amazon1._CB423492668_.jpg" alt="" />
                            <div className="title">
                                <h3 className="checkout_title">Check Your Shopping Basket</h3>
                                {basket.map(item => {
                                    <CheckoutProduct
                                        id='1'
                                        title='Great INDIAN Festival 10% HDFC BANK'
                                        image ="https://images-eu.ssl-images-amazon.com/images/G/31/img20/Events/JupiterT1/Eng_1x._SY304_CB640989812_.jpg"
                                        price={12.96}
                                        rating={4}
                                    />
                                })}
                            </div>
                        </div>
                    </Col>
                    <Col xl={4}>
                        <div className="Checkout_right">
                            <Subtotal />
                        </div>
                    </Col>
                </Row>
            </Container>
        </div>
    )
}
